var title_f1_63_2045="Laboratory evaluation for inborn errors of metabolism";
var content_f1_63_2045=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PEDS%2F67745&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PEDS%2F67745&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Laboratory evaluation for suspected inborn errors of metabolism",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        &nbsp;",
"       </td>",
"       <td class=\"subtitle1\">",
"        Comments",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"2\" rowspan=\"1\">",
"        Initial evaluation*",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle3_left\" colspan=\"2\" rowspan=\"1\">",
"        Blood tests",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        CBC with differential",
"       </td>",
"       <td>",
"        &nbsp;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        Blood glucose",
"       </td>",
"       <td>",
"        &nbsp;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        Electrolytes, BUN, creatinine, uric acid",
"       </td>",
"       <td>",
"        &nbsp;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        Arterial blood gas",
"       </td>",
"       <td>",
"        &nbsp;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        Serum ammonia",
"       </td>",
"       <td>",
"        Should be obtained from artery or vein without a tourniquet; the tube should be placed on ice for transport to the laboratory and analyzed immediately. If the plasma ammonia concentration is &gt;100 micromol/L (1.7 mcg/mL), the measurement should be repeated immediately.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        AST, ALT, bilirubin, PT",
"       </td>",
"       <td>",
"        If the patient has signs or symptoms of myopathy",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        LDH, aldolase, creatine, kinase",
"       </td>",
"       <td>",
"        &nbsp;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle3_left\" colspan=\"2\" rowspan=\"1\">",
"        Urine tests",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        Color, odor",
"       </td>",
"       <td>",
"        &nbsp;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        Urinalysis",
"       </td>",
"       <td>",
"        &nbsp;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        Reducing substances",
"       </td>",
"       <td>",
"        &nbsp;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        Myoglobin",
"       </td>",
"       <td>",
"        If the patient has signs or symptoms of myopathy",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"2\" rowspan=\"1\">",
"        Specialized tests",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle3_left\" colspan=\"2\" rowspan=\"1\">",
"        Blood tests",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        Quantitative plasma amino acids",
"       </td>",
"       <td>",
"        Plasma amino acid analysis must be performed quantitatively rather than qualitatively.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        Lactate and pyruvate",
"       </td>",
"       <td>",
"        Lactate and pyruvate should be measured in arterial blood, and transported on ice",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        Acylcarnitine profile",
"       </td>",
"       <td>",
"        Analysis of acylcarnitine conjugates is performed by tandem mass spectrometry and can be measured in a plasma sample or a filter-paper bloodspot; serum is preferred because of inherent problems in quantitating compounds from a filter-paper blood spot",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle3_left\" colspan=\"2\" rowspan=\"1\">",
"        Urine tests",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        Qualitative urine organic acids",
"       </td>",
"       <td>",
"        Minimum of 2 to 5 mL in sterile container without preservative",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     CBC: complete blood count; ALT: alanine aminotransferase; BUN: blood urea nitrogen; PT: prothrombin time; AST: aspartate aminotransferast; LDH: lactate dehydrogenase.",
"     <br>",
"      * If possible, blood and urine samples should be obtained for both the initial and specialized tests at the time of presentation. Samples for specialized tests should be processed and stored appropriately for further testing if indicated.",
"     </br>",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
