"   <div class=\"ttl\">",
"    Peritoneal equilibration test",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 491px; height: 276px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Time-dependent changes during peritoneal dialysis in dialysate (D) concentration of glucose (left panel) or creatinine (right panel) as a proportion of original dialysate glucose concentration (DO) or plasma creatinine concentration (P), respectively. The absorption of glucose from the dialysate gradually lowers the D/DO ratio, while the diffusion of creatinine into the dialysate raises the D/P ratio. Slow transporters may be inadequately dialyzed due to diminished solute removal. Rapid transporters can achieve a D/P creatinine ratio above 0.8 and a D/DO glucose below 0.3 at four hours; they may be predisposed to malnutrition from increased amino acid losses in the dialysate and to decreased fluid removal due to absorption of glucose.",
